-- Spatial indexes (optimizes geospatial queries)
CREATE INDEX idx_cities_boundary ON cities USING GIST(boundary);
CREATE INDEX idx_roads_route ON roads USING GIST(route);
CREATE INDEX idx_parks_boundary ON parks USING GIST(boundary);
CREATE INDEX idx_buildings_location ON buildings USING GIST(location);

-- Name indexes (optimizes lookups)
CREATE INDEX idx_cities_name ON cities(name);
CREATE INDEX idx_roads_name ON roads(name);
CREATE INDEX idx_parks_name ON parks(name);
CREATE INDEX idx_owning_entities_name ON owning_entities(name);

-- Population index (optimizes range queries, ex: cities with population > X)
CREATE INDEX idx_cities_population ON cities(population);

-- Foreign key indexes (optimizes joins)
CREATE INDEX idx_buildings_road_id ON buildings(road_id);
CREATE INDEX idx_buildings_owning_entity_id ON buildings(owning_entity_id);